import { Content } from "./components/index";
import { Header, Hero, MostPopular, Footer } from "./sections/index";
import "./App.css";
import React from "react";
function App() {
  return (
    <>
      <div >
        <Header />
        <Content>
          <>
            <Hero />
            <MostPopular />
          </>
        </Content>
        <Footer />
      </div>
    </>
  );
}

export default App;
